INSERT INTO `me_article_body` VALUES ('39', '# **# 导读： 很多人尝试了很多减肥方法，但是那些所谓的“神奇招数”却让明眼人一看就“心惊胆战”。传说中的21天苹果减肥法，前三天的食谱竟然是“水、水、水”，没错，就是什么都不吃，只喝水。这样的结果只能是血糖低、血压 ...**\n\n很多人尝试了很多减肥方法，但是那些所谓的“神奇招数”却让明眼人一看就“心惊胆战”。\n\n\n\n传说中的21天苹果减肥法，前三天的食谱竟然是“水、水、水”，没错，就是什么都不吃，只喝水。这样的结果只能是血糖低、血压不正常、身体能量不足、代谢变缓、饿出胃病...\n而近来又有消息称一个壮年小伙尝试水果减肥法，把香蕉、西瓜等高糖分的水果当晚餐。吃了一个月，结果出现头晕、口干、恶心的状况。经过检查，小伙子血液中血糖含量达79.98mol/l，是正常人的10多倍。血液PH为7.05，呈较严重的酸性。根据各项检查指标判断，小伙子得了糖尿病酮症酸中毒。\n\n\n\n住了3天ICU，才保住一条小命。\n\n\n\n医生提示到：用水果替代晚餐，可能引起人体内的营养摄入不均匀，再加上小伙子喜欢吃的水果，糖分含量十分高。他每天晚上所摄入的糖分，远远高于一顿晚饭的摄入量。这样极度不健康的饮食习惯就诱发了糖尿病酮症酸中毒，应该要合理搭配膳食。\n\n\n\n如果你是一个希望通过调整饮食来减轻体重的人，那么在盲目搜索所谓的快速减肥法之前，先学习一下“营养健康宝塔”。\n\n\n\n①类-谷薯类；\n\n②果类-蔬菜类、水果类；\n\n③蛋类-大豆类、奶类、肉蛋类；\n\n④油脂类-坚果类及其他油脂类。\n\n\n\n以上四类是我们身体无法或缺的营养元素。千万别轻信偏方，不吃或者疯狂进食某一种。\n\n\n\n以下是我为你推荐的简单好做的营养餐。谷物、蛋类、坚果、水果、蔬菜...分量不多，但是营养均衡。适合减肥期的你。\n![87.jpg](1)\n\n![b0.jpg](2)![e0.jpg](3)![e0.jpg](2)\n\n![b0.jpg](3)\n在这个年代，别太无知，健康科学减肥，才是正道。', '<h1><a id=\"__21__0\"></a><strong># 导读： 很多人尝试了很多减肥方法，但是那些所谓的“神奇招数”却让明眼人一看就“心惊胆战”。传说中的21天苹果减肥法，前三天的食谱竟然是“水、水、水”，没错，就是什么都不吃，只喝水。这样的结果只能是血糖低、血压 …</strong></h1>\n<p>很多人尝试了很多减肥方法，但是那些所谓的“神奇招数”却让明眼人一看就“心惊胆战”。</p>\n<p>传说中的21天苹果减肥法，前三天的食谱竟然是“水、水、水”，没错，就是什么都不吃，只喝水。这样的结果只能是血糖低、血压不正常、身体能量不足、代谢变缓、饿出胃病…<br />\n而近来又有消息称一个壮年小伙尝试水果减肥法，把香蕉、西瓜等高糖分的水果当晚餐。吃了一个月，结果出现头晕、口干、恶心的状况。经过检查，小伙子血液中血糖含量达79.98mol/l，是正常人的10多倍。血液PH为7.05，呈较严重的酸性。根据各项检查指标判断，小伙子得了糖尿病酮症酸中毒。</p>\n<p>住了3天ICU，才保住一条小命。</p>\n<p>医生提示到：用水果替代晚餐，可能引起人体内的营养摄入不均匀，再加上小伙子喜欢吃的水果，糖分含量十分高。他每天晚上所摄入的糖分，远远高于一顿晚饭的摄入量。这样极度不健康的饮食习惯就诱发了糖尿病酮症酸中毒，应该要合理搭配膳食。</p>\n<p>如果你是一个希望通过调整饮食来减轻体重的人，那么在盲目搜索所谓的快速减肥法之前，先学习一下“营养健康宝塔”。</p>\n<p>①类-谷薯类；</p>\n<p>②果类-蔬菜类、水果类；</p>\n<p>③蛋类-大豆类、奶类、肉蛋类；</p>\n<p>④油脂类-坚果类及其他油脂类。</p>\n<p>以上四类是我们身体无法或缺的营养元素。千万别轻信偏方，不吃或者疯狂进食某一种。</p>\n<p>以下是我为你推荐的简单好做的营养餐。谷物、蛋类、坚果、水果、蔬菜…分量不多，但是营养均衡。适合减肥期的你。<br />\n<img src=\"data:image/jpeg;base64,\" alt=\"87.jpg\" rel=\"1\" /></p>\n<p><img src=\"data:image/jpeg;base64,\" alt=\"b0.jpg\" rel=\"2\" /><img src=\"data:image/jpeg;base64,\" alt=\"e0.jpg\" rel=\"3\" /><img src=\"data:image/jpeg;base64,\" alt=\"e0.jpg\" rel=\"2\" /></p>\n<p><img src=\"data:image/jpeg;base64,\" alt=\"b0.jpg\" rel=\"3\" /><br />\n在这个年代，别太无知，健康科学减肥，才是正道。</p>\n');
INSERT INTO `me_article_body` VALUES ('40', '![99.jpg](http://localhost:8888/20210511/3f2bd3c5-4405-48cd-b3c1-105dcf3eb369_99.jpg)\n### 星期一早餐:\n馒头和草莓酱、牛奶(或豆奶)、\n煮荷包蛋1个、酱黄瓜。水果: 西红柿或白萝卜1个。中餐:荞麦大米饭、香\n菇菜心、糖醋带鱼、豆腐血旺、丝瓜汤。晚餐: 绿豆粥、白菜猪肉包子、虾皮.\n冬瓜。\n### 星期二早餐:\n玉米面窝窝头、牛奶(或豆奶)、卤五香茶蛋1个、豆腐乳\n(1/4块)。水果:枇杷(或长生果)3~4个。\n中餐:花生米饭、肉末茄\n子、葱花土豆泥、鸭子海带汤。晚餐: 干煸豆角、稀饭、豆沙包、青椒肉丝。\n### 星期三早餐:\n鲜肉包、牛奶(豆奶)、咸鸭蛋(半个)、素炒三丝(莴笋、白萝卜、\n胡萝卜)。水果:鸭梨一个或西瓜一块。中餐: 红枣米饭、黄豆烧牛肉、干煸四\n季豆、金针菇紫菜鸡蛋汤。晚餐: 三鲜面片(猪肝、火腿肠、黑木耳、平菇)、\n清炒菠菜、青椒土豆丝。星期四早餐: 苹果酱花卷、牛奶(或豆奶)、煮荷包蛋\n1个、炒泡豇豆。 水果:香蕉(或黄瓜) 1个。中餐:米饭(高粱米、白米)、\n香菇黄花黑木耳肉片、红烧平鱼、白萝卜海带排骨汤。\n晚餐:豆浆或稀饭、葱.\n花煎饼、青椒芹菜肉丝。星期五早餐: 酱肉包、牛奶(或豆奶)、素炒三丝(莴笋、白萝卜、胡萝卜)、鹌鹑蛋2个。水果:猕猴桃(或桃子) 1~2个。中餐:\n红豆米饭、魔芋烧鸭、红椒炒花菜、鱼头香菇冬笋青菜汤。晚餐: 芹菜猪肉包\n子、西红柿炒鸡蛋、肉末豆腐脑。星期六早餐: 面包、牛奶(或豆奶)、煎鸡蛋\n1个、卤五香豆腐干。水果:草莓(或李子) 5~6个。中餐:两米饭(大米、\n小米)、五香鱼、五彩银丝?穴黄豆芽、胡萝卜、莴笋)、鸡腿菇木耳猪肝汤。晚\n餐:玉米粥、鸡蛋发糕、鱼香肉丝。星期天早餐: 芝麻酱花卷、牛奶(或豆奶)、\n煮鸡蛋1个、豆豉凤尾鱼。水果: 苹果1个。中餐: 金银饭(玉米糁、大米)、\n黑木耳春笋烧鸡、糖醋白菜、绿豆南瓜汤。晚餐: 韭菜猪肉饺子、蒜泥油麦菜、\n肉末炒豇豆。一周营养菜谱 第一套:星期一 早餐:馒头，牛奶(或豆奶)、\n煮荷包蛋1个、酱黄瓜。中餐: 米饭、香菇菜心、糖醋带鱼、丝瓜汤。\n晚餐:\n绿豆粥、白菜猪肉包子、虾皮冬瓜。星期二早餐:窝窝头、牛奶(或豆奶)、\n卤蛋1个、豆腐乳中餐:米饭、肉末茄子、鸭子海带汤。\n晚餐:干煸豆角、稀\n饭、豆沙包、青椒肉丝。星期三 早餐:肉包子、牛奶(或豆奶)、咸鸭蛋(半个)中餐: 馒头、黄豆烧牛肉、干煸四季豆、鸡蛋汤。晚餐: 炒面、清炒菠菜、\n青椒土豆丝。星期四早餐:花卷、牛奶(或豆奶)、煮荷包蛋1个中餐:米饭、黑木耳肉片、红烧平鱼、白萝卜海带排骨汤。晚餐: 豆浆或稀饭、葱花饼、青\n椒芹菜肉丝。星期五 早餐:菜包子、牛奶(或豆奶)、中餐: 米饭、炒菜花、\n辣子鸡丁，香菇青菜汤。晚餐: 芹菜肉包子、西红柿炒鸡蛋、肉末烧豆腐。星\n期六早餐:面包、牛奶(或豆奶)、煎鸡蛋1个中餐:米饭、五香鱼、黄豆芽\n炒胡萝卜、香菇汤。晚餐: 馒头，玉米粥、番茄炒蛋、鱼香肉丝。星期天早\n餐:花卷、牛奶(或豆奶)、煮鸡蛋1个中餐:米饭黑木耳炒鸡丁、糖醋白菜、\n南瓜汤。\n晚餐:韭菜猪肉饺子、豆豉油麦菜、肉末炒豇豆。\n\n\n\n', '<p><img src=\"http://localhost:8888/20210511/3f2bd3c5-4405-48cd-b3c1-105dcf3eb369_99.jpg\" alt=\"99.jpg\" /></p>\n<h3><a id=\"_1\"></a>星期一早餐:</h3>\n<p>馒头和草莓酱、牛奶(或豆奶)、<br />\n煮荷包蛋1个、酱黄瓜。水果: 西红柿或白萝卜1个。中餐:荞麦大米饭、香<br />\n菇菜心、糖醋带鱼、豆腐血旺、丝瓜汤。晚餐: 绿豆粥、白菜猪肉包子、虾皮.<br />\n冬瓜。</p>\n<h3><a id=\"_6\"></a>星期二早餐:</h3>\n<p>玉米面窝窝头、牛奶(或豆奶)、卤五香茶蛋1个、豆腐乳<br />\n(1/4块)。水果:枇杷(或长生果)3~4个。<br />\n中餐:花生米饭、肉末茄<br />\n子、葱花土豆泥、鸭子海带汤。晚餐: 干煸豆角、稀饭、豆沙包、青椒肉丝。</p>\n<h3><a id=\"_11\"></a>星期三早餐:</h3>\n<p>鲜肉包、牛奶(豆奶)、咸鸭蛋(半个)、素炒三丝(莴笋、白萝卜、<br />\n胡萝卜)。水果:鸭梨一个或西瓜一块。中餐: 红枣米饭、黄豆烧牛肉、干煸四<br />\n季豆、金针菇紫菜鸡蛋汤。晚餐: 三鲜面片(猪肝、火腿肠、黑木耳、平菇)、<br />\n清炒菠菜、青椒土豆丝。星期四早餐: 苹果酱花卷、牛奶(或豆奶)、煮荷包蛋<br />\n1个、炒泡豇豆。 水果:香蕉(或黄瓜) 1个。中餐:米饭(高粱米、白米)、<br />\n香菇黄花黑木耳肉片、红烧平鱼、白萝卜海带排骨汤。<br />\n晚餐:豆浆或稀饭、葱.<br />\n花煎饼、青椒芹菜肉丝。星期五早餐: 酱肉包、牛奶(或豆奶)、素炒三丝(莴笋、白萝卜、胡萝卜)、鹌鹑蛋2个。水果:猕猴桃(或桃子) 1~2个。中餐:<br />\n红豆米饭、魔芋烧鸭、红椒炒花菜、鱼头香菇冬笋青菜汤。晚餐: 芹菜猪肉包<br />\n子、西红柿炒鸡蛋、肉末豆腐脑。星期六早餐: 面包、牛奶(或豆奶)、煎鸡蛋<br />\n1个、卤五香豆腐干。水果:草莓(或李子) 5~6个。中餐:两米饭(大米、<br />\n小米)、五香鱼、五彩银丝?穴黄豆芽、胡萝卜、莴笋)、鸡腿菇木耳猪肝汤。晚<br />\n餐:玉米粥、鸡蛋发糕、鱼香肉丝。星期天早餐: 芝麻酱花卷、牛奶(或豆奶)、<br />\n煮鸡蛋1个、豆豉凤尾鱼。水果: 苹果1个。中餐: 金银饭(玉米糁、大米)、<br />\n黑木耳春笋烧鸡、糖醋白菜、绿豆南瓜汤。晚餐: 韭菜猪肉饺子、蒜泥油麦菜、<br />\n肉末炒豇豆。一周营养菜谱 第一套:星期一 早餐:馒头，牛奶(或豆奶)、<br />\n煮荷包蛋1个、酱黄瓜。中餐: 米饭、香菇菜心、糖醋带鱼、丝瓜汤。<br />\n晚餐:<br />\n绿豆粥、白菜猪肉包子、虾皮冬瓜。星期二早餐:窝窝头、牛奶(或豆奶)、<br />\n卤蛋1个、豆腐乳中餐:米饭、肉末茄子、鸭子海带汤。<br />\n晚餐:干煸豆角、稀<br />\n饭、豆沙包、青椒肉丝。星期三 早餐:肉包子、牛奶(或豆奶)、咸鸭蛋(半个)中餐: 馒头、黄豆烧牛肉、干煸四季豆、鸡蛋汤。晚餐: 炒面、清炒菠菜、<br />\n青椒土豆丝。星期四早餐:花卷、牛奶(或豆奶)、煮荷包蛋1个中餐:米饭、黑木耳肉片、红烧平鱼、白萝卜海带排骨汤。晚餐: 豆浆或稀饭、葱花饼、青<br />\n椒芹菜肉丝。星期五 早餐:菜包子、牛奶(或豆奶)、中餐: 米饭、炒菜花、<br />\n辣子鸡丁，香菇青菜汤。晚餐: 芹菜肉包子、西红柿炒鸡蛋、肉末烧豆腐。星<br />\n期六早餐:面包、牛奶(或豆奶)、煎鸡蛋1个中餐:米饭、五香鱼、黄豆芽<br />\n炒胡萝卜、香菇汤。晚餐: 馒头，玉米粥、番茄炒蛋、鱼香肉丝。星期天早<br />\n餐:花卷、牛奶(或豆奶)、煮鸡蛋1个中餐:米饭黑木耳炒鸡丁、糖醋白菜、<br />\n南瓜汤。<br />\n晚餐:韭菜猪肉饺子、豆豉油麦菜、肉末炒豇豆。</p>\n');
